import React, { useState } from 'react';
import { AiOutlineMenu, AiOutlineClose } from 'react-icons/ai';

const Navbar = () => {
    const [nav, setNav] = useState(false);

    const handleNav = () => {
        setNav(!nav);
    };

    return (
        <div className='border border-gray-600 bg-black text-gray-400 h-[100px] max-w-[1200px] mx-auto flex justify-between items-center'>
            <h1 className='text-3xl font-bold primary-color ml-4'>Youssef</h1>
            <ul className='hidden md:flex'>
                <li className='p-5'><a href="#about">About</a></li>
                <li className='p-5'><a href="">Projects</a></li>
                <li className='p-5'><a href="">Contact</a></li>
            </ul>
            <div onClick={handleNav} className='block md:hidden mr-6'>
                {nav ? <AiOutlineClose size={20} /> : <AiOutlineMenu size={20} className='text-white' />}
            </div>

            <div className={nav ? 'z-10 fixed left-0 top-0 w-[60%] h-full border-r bg-[#202121] ease-in-out duration-500' : 'fixed left-[-100%]'}>
                <h1 className='text-3xl primary-color m-4'>Youssef</h1>
                <ul className='p-8 text-2xl'>
                    <li className='p-2'><a href="">About</a></li>
                    <li className='p-2'><a href="">Projects</a></li>
                    <li className='p-2'><a href="">Contact</a></li>
                </ul>
            </div>
        </div>
    );
};

export default Navbar;
